INSERT INTO `constellation_fortune` VALUES (1,'물병자리','반가운 만남이 예상되는 하루입니다. 먼 곳에서 친구가 찾아오니 뜻밖의 기쁨을 얻게 됩니다. 전혀 기대하지 못했던 어떤 도움으로 오랫동안 골머리를 앓아 왔던 문제가 씻은 듯 해결될 것입니다. 잊고 있었던 투자금은 배가 되어 돌아옵니다. 기혼자는 새로운 가족이 생길 것이고 싱글은 새로운 인연이 닿을 것입니다. 풍성한 저녁이 예상되며 잠자리까지 평온하게 이어 집니다.'),(2,'물고기자리','자신의 재능에 확신이 서니 자신감이 넘칩니다. 그러나 마땅히 자신을 알아주는 곳이 없으니 마음만 급할 뿐 답답한 별의 기운입니다. 이러한 때일수록 섣부른 판단과 결정은 실수를 초래하기 쉽습니다. 뜻밖의 사람이나 재물을 통해 다소 도움을 얻을 수도 있겠지만, 더욱 중요한 것은 다른 사람에 의존하지 않고 홀로 서는 당신의 의지일 것입니다. 좋은 기운 좋게 마무리 하시길 바랍니다.'),(3,'양자리','기적과도 같은 행운이 깃들어 있으니 뜻밖의 도움을 기대할 수 있는 하루입니다. 하는 일이 막막하고 희망이 보이지 않더라도 묵묵히 제 자리를 지켜나가시기 바랍니다. 주눅들지 말고 대담하게 앞장서서 일을 추진하십시오. 아름답고 탐스러운 꽃송이가 벌, 나비를 부르는 형상이랍니다. 잊지 말아야 할 것이 있다면 먼 곳에 있는 물은 가까운 곳의 화재를 막을 수 없고, 먼 곳의 친척은 가까운 이웃만 못하다는 것입니다.'),(4,'황소자리','순탄한 하루입니다. 모처럼 마음의 여유를 즐길 수 있을 때 차분히 앞날을 생각해 보는 시간을 가져 보시길 바랍니다. 고난이나 기쁨, 여유도 우리 인생에 관여하는 운명의 섭리일 것입니다. 미래를 계획하는 소중한 하루가 될 것입니다. 뜻밖의 행운은 스스로 노력하는 사람에게 따르기 마련입니다. 오늘 밤에는 동네 근처에서 산책을 추천해 봅니다. 가급적이면 시계 방향이 좋겠습니다.'),(5,'쌍둥이자리','그동안 힘든 시기였지만 잘 극복해 왔습니다. 이제야 지난날의 어려움이 끝나고 보다 나은 시절이 약속될 것입니다. 오늘, 당신은 즐거운 일들의 조짐을 만나볼 수 있을 것입니다. 또한 당신의 노력과 수고가 앞으로 속속 풍성한 결실로 나타날 것입니다. 싱글이라면 인연이 기대되고 연인이라면 프로포즈가 성공 할 조짐입니다. 결혼한 사람이라면 더 없이 행복한 순간을 만끽 할 것입니다.'),(6,'게자리','중심 생각이나 태도의 확립이 절실히 요구되는 하루입니다. 고대하던 기회를 만났지만 확고한 신념을 가지고 밀어 부치지 못한다면 아무리 좋은 기회도 소용이 없습니다. 또 기회란 늘 우리 곁에 머물러 있지 않답니다. 기회는 그냥 어쩌다 오는 우연이 아니라 당신 마음의 부름으로 인해 온답니다. 그러한 행운의 기회를 부르는 가장 강력한 요소는 그것을 이루기 위한 적극적인 마음이랍니다.'),(7,'사자자리','정원사의 가치가 발휘되는 순간입니다. 넓디넓은 정원에 온갖 나무와 화초들이 자라고 있었지만 항상 아쉬웠던 점은 가지치기를 하지 못했다는 것이었습니다. 더불어 그동안 미뤄왔던 일들의 매듭짓는 것이 좋겠습니다. 뜻하는 바가 분명하고 의지가 굳으니 좋은 결과가 기대되는 하루입니다. 새로운 이성을 만나기에 좋고 또한 새로운 직장을 알아보는 것도 괜찮겠습니다.'),(8,'처녀자리','기나긴 어려운 시절을 지나 이제 그 끝에 이르렀습니다. 참으로 수고하셨습니다. 이제 다가올 날은 하나하나 일의 실마리가 풀리면서 매우 기쁜 소식을 듣게 될 것입니다. 운명은 희망을 잃지 않고 매일매일 최선을 다해 사는 인간을 저버리지 않는 법이니까요. 당신의 목표를 마음 속에 명확히 하고, 그 다짐을 되풀이하면 현실로 이루어지는 마술을 보게 될 것입니다.'),(9,'천칭자리','어떠한 일이라도 도전하는 사람에겐 경험적인 측면으로 성과를 얻을 수 있습니다. 지금은 당신을 위해 준비된 시간이라고 생각해보세요. 모든 일이 당신의 의지가 반영됨에 따라 움직여갈 것입니다. 초심을 잃지 않는 모습이야말로 모두가 지향해야 할 모범적인 태도일 것이니, 꾸준히 지켜나가도록 노력하시기 바랍니다. 이직을 준비중인 사람이라면 자신감을 갖고 현 상황에서 벗어나야 합니다.'),(10,'전갈자리','참을성이 요구되는 하루입니다. 시도하는 일이 수시로 장애에 부딪힐 것입니다. 그러나 차근차근 문제를 해결해 나가려는 노력 가운데 자신도 모르게 당신의 내면에 축적되는 무엇이 있음을 느낄 수 있을 것입니다. 운이 활짝 트인 시기가 아니더라도 힘들게 보낸 오늘 하루의 수고가 결코 헛된 일은 아닐 것입니다. 하루의 마무리는 산책으로 지으십시오. 창업을 준비하는 사람이라면 달력에서 답을 찾을 수 있겠습니다.'),(11,'사수자리','자신의 능력을 발휘하고 그에 걸맞는 물질로 대우를 받는 것은 당연한 일이지요. 또한 사람들로부터 칭찬을 듣는 것은 물론 재능을 인정받게 되니 만족스런 하루가 될 것입니다. 세상에 두려울 것이 없겠군요. 그러나 겸손 하십시오. 뒤에 우환이 따를 수도 있겠습니다. 만족감이란 한 번에 충족되는 것보다 조금씩 나눠서 충족되는 편이 더 중요 하답니다. 남자라면 사업을 구상해봐도 좋은 날 이겠습니다.'),(12,'염소자리','뜻밖의 도움이나 상황으로 횡재수가 발생하거나 일의 성취를 맛볼 수 있는 하루가 될 것입니다. 직장내에서 혹은 학업에서 좋은 결과를 얻거나 크게 발전할 수 있는 계기가 마련되는 시기입니다. 기회가 왔을 때 놓쳐버리지 않도록 주변을 잘 살피고, 사람들과 갈등이 생기지 않도록 신경 쓰세요. 뜻밖의 횡재수도 있어서 생각지도 못한 보너스를 받게 되거나 용돈이 생길 수 있습니다. 복권을 사두는 것도 좋겠네요!');
