INSERT INTO `sleep_tip` VALUES (5,'음식','체리는 수면 사이클을 조정하는데 도움이 되는 호르몬인 멜라토닌을 함유하고 있다. 한 연구에 따르면 매일 체리주스를 2잔씩 마시는 사람들은 그렇지 않은 사람들보다 40분 정도 더 긴 양질의 수면을 취할 수 있다. 또 체리는 불면증의 강도를 떨어뜨리는 역할을 해 만성적인 불면증에 시달리고 있는 사람들에게도 도움이 된다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/cherry.jpg','체리'),(6,'음식','바나나는 아침을 상쾌하게 여는데 도움이 되는 과일인 동시에 아이러니하게도 밤잠을 잘 자게 만드는데도 도움이 된다. 바나나에 든 비타민 B6는 뇌의 활동을 촉진시켜 아침 시간 정신을 맑게 깨우는 작용을 한다. 또 마그네슘과 칼륨은 근육의 긴장을 이완시켜 몸을 편안하게 만들고 휴식을 취하는데 도움을 준다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/banana.jpg','바나나'),(7,'음식','초조하고 불안감을 동반한 불면증 환자에게 도움이 된다. 대추는 심장 기능을 촉진하고 혈액 순환을 원활하게 하는 작용을 하는 것으로 알려져 있다. 대추는 그냥 먹을 수도 있지만, 차로 만들어 먹으면 좋다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/jujube.jpg','대추'),(8,'음식','우유 역시 잘 알려진 불면증에 좋은 식품이다. 칼슘이 풍부해 마음을 안정시켜 준다. 또한 잠을 부르는 성분인 세로토닌의 주성분인 트립토판이 풍부하다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/milk.jpg','우유'),(9,'음식','샐러리는 스트레스가 많은 직장인과 학생들의 체내 열을 내리는 작용을 해 수면을 돕는다. 두통 완화 효과도 있다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/celery.jpg','샐러리'),(10,'음식','상추 역시 두통을 동반한 불면증에 좋다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/lettuce.jpg','상추'),(11,'음식','피로를 많이 느끼는 불면증에 특히 좋다. 양파에는 매운 향을 내는 유기 유황 성분인 알리인이 많이 함유돼 있다. 알리인은 뇌를 자극해 혈액 순환을 돕고 정신을 안정시킨다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/onion.jpg','양파'),(12,'음식','키위는 신경전달 기능을 도와 숙면을 돕는 이노시톨과 신경계에 중요한 엽산이 많이 함유된 과일이다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/kiwi.jpg','키위'),(13,'음식','아몬드에는 단백질이 풍부해 숙면에 도움이 된다. 또 근육을 적절히 이완시키는 마그네슘이 함유돼 있어 수면을 취하기 전에 소량의 아몬드를 섭취하면 도움이 된다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/almond.jpg','아몬드'),(14,'음식','호두는 콩팥 기능을 강화시키고 호흡기와 장을 원활하게 하며, 에너지를 돋우고 뇌에 영양을 공급해 주는 식품이다. 이 같은 순기능들이 모여 궁극적으로 불면을 예방하고 숙면을 취할 수 있게 도와준다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/walnut.jpg','호두'),(15,'음식','파는 비타민A, B1, B2, C, D, E 등 이 풍부한 비타민 채소이다. 파의 특유한 향기를 내는 유화알릴 성분이 진정작용을 한다. 특히 신경과민 또는 흥분으로 잠을 자기가 어려운 경우 이 향기를 맡는 것만으로도 도움이 된다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/greenonion.jpg','파'),(16,'음식','전통적으로 불면증에는 호박을 삶아 먹으면 효과가 있는 것으로 전해져 왔다. 수면 잠복기를 짧아지게 하고, 숙면을 취하게 하며, 깨어나면 상쾌함을 느끼게 해준다. 물론 삶아 먹는 방법 이외에도 구워먹거나 죽을 쑤어 먹을 수도 있다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/foodtip/pumpkin.jpg','호박'),(22,'팁','위에 음식이 남아 있는 경우 소화를 위해 우리 몸이 쉬지 못하기 때문에 깊은 수면을 방해합니다. 잠자기 3시간 전부터는 음식 섭취를 제한하여 숙면을 돕고 역류성 식도염을 예방합니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip1.jpg','잠자기 전 음식 섭취의 제한'),(23,'팁','밝은 빛과 소음은 우리 뇌를 자극하여 깨어 있게 만듭니다. 조명을 낮추고, TV 시청이나 핸드폰 사용을 자제하고 어둡고 조용한 분위를 만듦으로써 잠에 드는 것을 유도합니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip2.jpg','수면 환경 조성하기'),(24,'팁','몸이 피로하면 떡실신하여 숙면을 취할 수 있을 것 같지만, 사실 과도한 운동은 근육을 긴장 시켜 숙면을 방해 합니다. 너무 늦은 시간에는 근육을 이완 시키는 가벼운 스트레칭이나 요가와 같은 정적이고 가볍게 몸을 풀어 줄 수 있는 정도의 운동을 권장합니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip3.jpg','늦은 저녁 과도한 운동 금지'),(25,'팁','카페인과 알코올은 숙면을 방해하는 대표적인 요소인데, 커피, 녹차, 홍차, 우롱차 등은 카페인을 많이 함유하고 있으므로 자기 전에 마시는 것은 피해야 합니다. 와인은 혈액 순환을 촉진하고 수면을 유도하는 것으로 알려져 있으나 과도한 알코올 섭취는 숙면을 방해하는 것으로 알려져 있습니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip4.jpg','카페인과 알코올 섭취 제한'),(26,'팁','적절한 실내 온도는 20~24도, 습도는 40~60% 정도라고 합니다. 자신에게 맞는 쾌적한 환경을 조정하고 위생적이고 깔끔한 침구류로 쾌적한 환경을 만드는 것은 매우 중요합니다. 자신에게 맞는 온,습도를 찾으세요.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip5.jpg','쾌적한 잠자리 환경'),(27,'팁','칼륨과 마그네슘이 많이 함유된 바나나와 캐모마일 같은 허브차, 따뜻한 유유는 몸을 이완 시켜 숙면에 도움이 되는 대표적인 음식입니다. 단, 자기 직전에 섭취하는 것은 숙면을 방해 할 수 있으니 피하는 것이 좋습니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip6.jpg','숙면에 좋은 음식 섭취'),(28,'팁','따뜻한 물은 혈액 순환을 촉진하여 몸을 이완 시켜 피로 회복에 도움이 됩니다. 족욕을 할 때는 따뜻한 물과 함께 아로마 오일을 사용하는 것도 좋은 효과를 줍니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip7.jpg','족욕이나 따뜻한 물로 가볍게 샤워하기'),(29,'팁','양초나 아로마 향은 심신을 안정 시키고 몸을 이완 시켜 숙면에 도움이 됩니다. 특히, 라벤더, 캐모마일과 같은 아로마 오일은 불안한 마음을 진정 시키고, 근육을 이완, 불면증 해소에 탁월한 효과를 가지고 있는 것으로 알려져 있습니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip8.jpg','양초와 아로마 테라피'),(30,'팁','누구나 고민이 있는 날이면 평소 잘 자던 사람도 잠이 잘 오지 않는 경험을 해 보았을 것입니다. 자기 전 가벼운 명상을 통해 스트레스를 조절하고 걱정을 떨쳐 버리려는 노력이 필요합니다. 불필요한 잡념은 깊은 숙면을 방해합니다.','2024-11-08 00:00:00.000000','https://sleeptip.s3.ap-northeast-2.amazonaws.com/tooltip/tip9.jpg','스트레스 조절, 가벼운 명상');
